$(function(){var e=$("#benefitsCalcForm");e.submit(function(i){i.preventDefault(),$.ajax({url:"getbenefits",method:"GET",data:e.serialize()}).done(function(e){var i,t=JSON.parse(e),n=$("#benefitsList");if(n.empty(),t.invalidZip)$("#benefitsCounty").text(t.invalidZip),n.append("<li>Oops! Looks like you entered an incorrect zip code. Please try again.</li>");else{for(var a=0;a<t.length;a++)i=t[a].benefit.split(/ (.+)?/),n.append('<li><span class="value">'+i[0]+"</span> "+i[1]+"</li>");$("#benefitsCounty").text(t[0].county)}})})});
